import React, { useState, useEffect } from 'react';
import { Clock, Users, FileText, Code, BookOpen, Play } from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import { testService } from '../services/testService';

export default function MyTest() {
  const [tests, setTests] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    fetchTests();
  }, []);

  const fetchTests = async () => {
  try {
    const response = await testService.getAllTests();

    // Ensure it's always an array
    const data = Array.isArray(response.data) 
      ? response.data 
      : response.data.data || [];  // adjust if your API wraps data inside `data`

    setTests(data);
  } catch (error) {
    console.error('Failed to fetch tests:', error);
    setTests([]); // fallback to empty array
  } finally {
    setLoading(false);
  }
};


  const getTestTypeIcon = (type) => {
    switch (type) {
      case 'MCQ': return <BookOpen className="h-5 w-5" />;
      case 'Long': return <FileText className="h-5 w-5" />;
      case 'Coding': return <Code className="h-5 w-5" />;
      default: return <FileText className="h-5 w-5" />;
    }
  };

  const getTestTypeColor = (type) => {
    switch (type) {
      case 'MCQ': return 'bg-blue-100 text-blue-800';
      case 'Long': return 'bg-emerald-100 text-emerald-800';
      case 'Coding': return 'bg-purple-100 text-purple-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const handleTakeTest = (testId) => {
    navigate(`/take-test/${testId}`);
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-blue-600"></div>
          <p className="mt-4 text-gray-600">Loading tests...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Available Tests</h1>
          <p className="mt-2 text-gray-600">Choose a test to begin your assessment</p>
        </div>

        {tests.length === 0 ? (
          <div className="text-center py-12">
            <div className="mx-auto h-24 w-24 text-gray-400">
              <FileText className="h-full w-full" />
            </div>
            <h3 className="mt-4 text-lg font-medium text-gray-900">No tests available</h3>
            <p className="mt-2 text-gray-500">There are no tests created yet.</p>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {tests.map((test) => (
              <div
                key={test._id}
                className="bg-white rounded-xl shadow-lg border border-gray-100 overflow-hidden hover:shadow-xl transition-all duration-300"
              >
                <div className="p-6">
                  <div className="flex items-start justify-between mb-4">
                    <h3 className="text-xl font-semibold text-gray-900 line-clamp-2">{test.name}</h3>
                    <span
                      className={`px-3 py-1 rounded-full text-xs font-medium flex items-center space-x-1 ${getTestTypeColor(test.type)}`}
                    >
                      {getTestTypeIcon(test.type)}
                      <span>{test.type}</span>
                    </span>
                  </div>

                  <div className="space-y-3 mb-6">
                    <div className="flex items-center text-sm text-gray-600">
                      <FileText className="h-4 w-4 mr-2" />
                      <span>{test.questions.length} Questions</span>
                    </div>
                    <div className="flex items-center text-sm text-gray-600">
                      <Clock className="h-4 w-4 mr-2" />
                      <span>{test.duration} Minutes</span>
                    </div>
                    <div className="flex items-center text-sm text-gray-600">
                      <Users className="h-4 w-4 mr-2" />
                      <span>{test.totalMarks} Max Marks</span>
                    </div>
                  </div>

                  <button
                    onClick={() => handleTakeTest(test._id)}
                    className="w-full bg-blue-600 hover:bg-blue-700 text-white font-medium py-3 px-4 rounded-lg transition-colors duration-200 flex items-center justify-center space-x-2"
                  >
                    <Play className="h-4 w-4" />
                    <span>Take Test</span>
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}
